    "using Plots\n",
    "\n",
    "function Ids_HEMT(vds::Float64, vgs::Float64)\n",
    "\n",
    "\t# Ids = beta*Wg/Lg*(Imax+vgs^Ngs)/(Imax+vgs^Ngs)*tanh(alpha*vds)\n",
    "\n",
    "\tum = 1.0e-6;\n",
    "\tcm = 1.0e-2;\n",
    "\n",
    "\tbeta = 1.0e-3;\n",
    "\tWg = 10*um;\n",
    "\tLg = 0.2*um;\n",
    "\tImax = 4.0;\n",
    "\tNgs = 2.0;\n",
    "\talpha = 3.0;\n",
    "\tVth = -0.5;\n",
    "\n",
    "    gamma = 1e-3;\n",
    "    lambda = 1e-4;\n",
    "    VBR = 6.0;\n",
    "    IBR = 5e-2;\n",
    "    NBR = 0.5;\n",
    "    VBRe = 7.0;\n",
    "    IBRe = 0e-3;\n",
    "    NBRe = 0.5;\n",
    "\n",
    "\tK = beta*Wg/Lg;\n",
    "\n",
    "\tvgsx = vds <0 ? vgs - vds+vds*gamma : vgs+vds*gamma;\n",
    "\n",
    "\tvgst = vgsx-Vth <=0 ? 0 : vgsx-Vth;\n",
    "\n",
    "    if vds >=0\n",
    "         ibr = exp(-VBR/NBR)*(exp((vds)/NBR)-1.0)*IBR;\n",
    "    else\n",
    "         ibr = exp(-VBR/NBR)*(exp(abs(vds)/NBR)-1.0)*IBR;\n",
    "    end\n",
    "    if vds >=0\n",
    "         ibre = exp(-VBRe/NBRe)*(exp((vds)/NBRe)-1.0)*IBRe;\n",
    "    else\n",
    "         ibre = -exp(-VBRe/NBRe)*(exp(abs(vds)/NBRe)-1.0)*IBRe;\n",
    "    end\n",
    "\n",
    "\n",
    "\tidsgs = (Imax*(vgst^Ngs)+ibr)/((Imax+vgst^Ngs));\n",
    "\tidsds = tanh(alpha*vds);\n",
    "\n",
    "\treturn K*idsgs*idsds+lambda*vds+ibre;\n",
    "end\n",
    "\n",
    "function HEMTmain()\n",
    "\tNds = 1001;\n",
    "\tNgs = 16;\n",
    "\tvdsx =zeros(Nds, Ngs);\n",
    "\tidsx = zeros(Nds, Ngs)\n",
    "\tvds = 0.0;\n",
    "\tvgs = 0.0;\n",
    "\tvdsmin = -0.50;\n",
    "\tvdsmax = 5.0;\n",
    "\tvgsmin = -2.0;\n",
    "\tvgsmax = 2.0;\n",
    "\tfor j = 1: Ngs\n",
    "\t\tvgs = float(j-1)/Ngs*(vgsmax - vgsmin) + vgsmin;\n",
    "\t\tfor i = 1: Nds\n",
    "\t\t\tvds = float(i-1)/Nds*(vdsmax - vdsmin) + vdsmin;\n",
    "\t\t\tvdsx[i, j] = vds;\n",
    "\t\t\tidsx[i, j] = Ids_HEMT(vds, vgs);\n",
    "\t\tend\n",
    "\tend\n",
    "\n",
    "\tPlots.plot(vdsx, idsx, xaxis=\"Vds\", yaxis=\"Ids\", leg=false, color=:black);\n",
    "\t#PyPlot.plot(vdsx, idsx);\n",
    "\t#PyPlot.grid(true)\n",
    "end\n",
    "\n",
    "HEMTmain()"
   ]
